import React, { Component } from "react";
import Axios from "axios";

class law_report extends Component {
  constructor(props) {
    super(props);
    this.state = {
      lawyers: "hi",
    };
  }
  componentDidMount = () => {
    const url = "/lawyersReporter";
    Axios.get(url).then((response) => {
      //console.log(response.data.tem_c);
      console.log(response.data);
      //fetch();
    });
  };

  render() {
    let className = "menu";
    if (this.props.isActive) {
      className += " menu-active";
    }
    return;
    <div>
      <span className={className}>Menu</span>
      This is the list of lawyers
    </div>;
  }
}

export default law_report;
